import React from "react";
import MenuRoundedIcon from "@material-ui/icons/MenuRounded";
import "./SubHeader.css";

function SubHeader() {
  return (
    <div className="subheader">
      <div className="subheader__option">
        <MenuRoundedIcon style={{ color: "white" }} />
        <span className="subheader__optionLine">All</span>
        <span className="subheader__optionLine">Prime Video</span>
        <span className="subheader__optionLine">Your Amazon.com</span>
        <span className="subheader__optionLine">Prime</span>
        <span className="subheader__optionLine">Coupons</span>
        <span className="subheader__optionLine">Customer Service</span>
        <span className="subheader__optionLine">Best Sellers</span>
        <span className="subheader__optionLine">Browsing History</span>

        <span className="subheader__optionLine">Buy Again</span>
        <span className="subheader__optionLine">Fresh</span>
        <span className="subheader__optionLine">Whole Foods</span>
        <span className="subheader__optionLine">Find a Gift</span>

        <span className="subheader__optionLine">True love, low prices</span>
      </div>
    </div>
  );
}

export default SubHeader;
